/* Theme: businessBlue */
@theme reference {
  --color-businessBlue-background: 0 0% 100%;
  --color-businessBlue-foreground: 0 0% 3.9%;
  --color-businessBlue-card: 0 0% 100%;
  --color-businessBlue-card-foreground: 0 0% 3.9%;
  --color-businessBlue-popover: 0 0% 100%;
  --color-businessBlue-popover-foreground: 0 0% 3.9%;
  --color-businessBlue-primary: 221 79% 48%;
  --color-businessBlue-primary-foreground: 0 0% 98%;
  --color-businessBlue-secondary: 204 45% 98%;
  --color-businessBlue-secondary-foreground: 0 0% 9%;
  --color-businessBlue-muted: 210 40% 96%;
  --color-businessBlue-muted-foreground: 0 0% 45.1%;
  --color-businessBlue-accent: 214 95% 93%;
  --color-businessBlue-accent-foreground: 0 0% 9%;
  --color-businessBlue-destructive: 0 75% 51%;
  --color-businessBlue-destructive-foreground: 0 0% 100%;
  --color-businessBlue-border: 214 32% 91%;
  --color-businessBlue-input: 214 32% 91%;
  --color-businessBlue-ring: 221 79% 48%;
}

.theme-businessBlue {
  --color-background: var(--color-businessBlue-background);
  --color-foreground: var(--color-businessBlue-foreground);
  --color-card: var(--color-businessBlue-card);
  --color-card-foreground: var(--color-businessBlue-card-foreground);
  --color-popover: var(--color-businessBlue-popover);
  --color-popover-foreground: var(--color-businessBlue-popover-foreground);
  --color-primary: var(--color-businessBlue-primary);
  --color-primary-foreground: var(--color-businessBlue-primary-foreground);
  --color-secondary: var(--color-businessBlue-secondary);
  --color-secondary-foreground: var(--color-businessBlue-secondary-foreground);
  --color-muted: var(--color-businessBlue-muted);
  --color-muted-foreground: var(--color-businessBlue-muted-foreground);
  --color-accent: var(--color-businessBlue-accent);
  --color-accent-foreground: var(--color-businessBlue-accent-foreground);
  --color-destructive: var(--color-businessBlue-destructive);
  --color-destructive-foreground: var(--color-businessBlue-destructive-foreground);
  --color-border: var(--color-businessBlue-border);
  --color-input: var(--color-businessBlue-input);
  --color-ring: var(--color-businessBlue-ring);
}

@media (prefers-color-scheme: dark) {
  .theme-businessBlue {
    --color-background: 240 10% 3.9%;
    --color-foreground: 0 0% 98%;
    --color-card: 240 10% 3.9%;
    --color-card-foreground: 0 0% 98%;
    --color-popover: 240 10% 3.9%;
    --color-popover-foreground: 0 0% 98%;
    --color-primary: 221 79% 88%;
    --color-primary-foreground: 240 5.9% 10%;
    --color-secondary: 240 3.7% 15.9%;
    --color-secondary-foreground: 0 0% 98%;
    --color-muted: 240 3.7% 15.9%;
    --color-muted-foreground: 240 5% 64.9%;
    --color-accent: 214 95% 33%;
    --color-accent-foreground: 0 0% 98%;
    --color-destructive: 0 62.8% 30.6%;
    --color-destructive-foreground: 0 0% 98%;
    --color-border: 240 3.7% 15.9%;
    --color-input: 240 3.7% 15.9%;
    --color-ring: 221 79% 88%;
  }
}

